SELECT CONCAT('/repositories/', ao.repo_id, '/archival_objects/', ao.id) as uri
	, ao.display_string as ao_title
	, event_data.event_type
	, dob_data.do_titles
	, GROUP_CONCAT(DISTINCT extent.number) as extent_number
	, GROUP_CONCAT(DISTINCT ev.value SEPARATOR '; ') as extent_info
	, GROUP_CONCAT(DISTINCT CONCAT(IFNULL(ev2.value, ''), ' ', IFNULL(tc.indicator, ''), ' ', IFNULL(ev3.value, ''), ' ', IFNULL(sc.indicator_2, '')) SEPARATOR '; ') as tc_indicator
	, GROUP_CONCAT(DISTINCT cp.name SEPARATOR '; ') as cp_info
FROM archival_object ao
JOIN (SELECT ao.id as ao_id
		  , GROUP_CONCAT(DISTINCT dob.title SEPARATOR '; ') as do_titles
		  , GROUP_CONCAT(DISTINCT fv.file_uri SEPARATOR '; ') as do_file_versions
		FROM archival_object ao
		JOIN instance on instance.archival_object_id = ao.id
		JOIN instance_do_link_rlshp idlr on instance.id = idlr.instance_id
		LEFT JOIN digital_object dob on idlr.digital_object_id = dob.id
		LEFT JOIN enumeration_value ev2 on ev2.id = instance.instance_type_id
		LEFT JOIN file_version fv on fv.digital_object_id = dob.id
		WHERE dob.repo_id = 12
		AND dob.digital_object_id not like "%130.132%"
		AND dob.digital_object_id not like '%digcoll%'
		AND dob.title not like '%Google Drive%'
		AND dob.title not like '%CONTENTdm%'
		AND dob.digital_object_id not like '%aviary%'
		AND dob.digital_object_id not like '%ms_%'
		AND dob.digital_object_id not like '%ru_%'
		AND dob.digital_object_id not like '%handle%'
		AND dob.digital_object_id not like '%Digital File%'
		AND dob.digital_object_id not like '%Digital Object ID%'
		GROUP BY ao.id) dob_data on dob_data.ao_id = ao.id
LEFT JOIN (SELECT ao.id as ao_id
		, ev.value as event_type
		FROM archival_object ao
		LEFT JOIN event_link_rlshp elr on elr.archival_object_id = ao.id
		LEFT JOIN event on elr.event_id = event.id
		LEFT JOIN enumeration_value ev on ev.id = event.event_type_id
		WHERE ev.value like '%digitization%'
		OR ev.value like '%ingest%') as event_data on event_data.ao_id = ao.id
LEFT JOIN extent on extent.archival_object_id = ao.id
LEFT JOIN enumeration_value ev on ev.id = extent.extent_type_id
LEFT JOIN instance on instance.archival_object_id = ao.id
LEFT JOIN sub_container sc on sc.instance_id = instance.id
LEFT JOIN top_container_link_rlshp tclr on tclr.sub_container_id = sc.id
LEFT JOIN top_container tc on tc.id = tclr.top_container_id
LEFT JOIN top_container_profile_rlshp tcpr on tcpr.top_container_id = tc.id
LEFT JOIN container_profile cp on cp.id = tcpr.container_profile_id
LEFT JOIN enumeration_value ev2 on ev2.id = tc.type_id
LEFT JOIN enumeration_value ev3 on ev3.id = sc.type_2_id
WHERE ao.repo_id = 12
AND event_data.event_type is NULL
AND ao.id in (963995, 2050674, 1468918, 2134438, 2298347, 1356003, 2771245, 1230651, 1002507, 1002595, 1002664, 1190561, 1190570, 1190576, 1190593, 1190585, 1210030, 3180240, 3180004, 3181924, 3180242, 1091894, 3181927, 3181928, 3192668, 3210882, 967117, 967118, 967119, 967121, 967120, 1956831, 1956840, 1189846, 1189860, 2086645, 3236961, 3245237, 2090513, 939890, 939999, 3181929)
GROUP BY ao.id

